import React, {useEffect} from 'react';
import {useParams} from "react-router-dom";
import {useDispatch} from "react-redux";
import {useAppDispatch, useAppSelector} from "../../hooks/redux";
import {fetch_ware_by_id} from "../../redux/action_creators/ware_action_creator";
import {Carousel} from "react-bootstrap";

const WarePage = () => {
    const id = useParams()
    const dispatch = useAppDispatch()
    const {ware} = useAppSelector(state => state.wareReducer)

    useEffect(() => {
        if (id !== undefined){
            console.log(id)
            dispatch(fetch_ware_by_id(Number(id.id)))
        }
    }, [ ])

    return (
        <div className={'container'}>
            <Carousel variant={'dark'}>
                <Carousel.Item>
                    <img
                        className="d-block w-25 text-center mx-auto"
                        src="https://static.staff-clothes.com/uploads/media/image_product/0002/68/93ee5869478d4f86bdba8e694077f236.jpeg"
                        alt="First slide"
                    />
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-25 text-center mx-auto"
                        src="https://static.staff-clothes.com/uploads/media/image_product/0002/68/93ee5869478d4f86bdba8e694077f236.jpeg"
                        alt="First slide"
                    />
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-25 text-center mx-auto"
                        src="https://static.staff-clothes.com/uploads/media/image_product/0002/68/93ee5869478d4f86bdba8e694077f236.jpeg"
                        alt="First slide"
                    />
                </Carousel.Item>
            </Carousel>
        </div>
    );
};

export default WarePage;
